import axios from 'axios';


function Logout() {
  const baseUrl = "http://localhost/00_GS/01_assignment/10_php4";

  axios.post(baseUrl+'/api/logout.php')
  .then((response) => {
    sessionStorage.clear();
    window.location.href = '/login';
  })
  .catch((error) => {
     console.error(error);
  });
}

export default Logout;
